def ui_Button_Button_create(comp_parent):
    cui_Button_Button = lv.btn(comp_parent)
    cui_Button_Button.set_width(223)
    cui_Button_Button.set_height(96)
    cui_Button_Button.set_align( lv.ALIGN.BOTTOM_MID)
    SetFlag(cui_Button_Button, lv.obj.FLAG.SCROLLABLE, False)
    SetFlag(cui_Button_Button, lv.obj.FLAG.SCROLL_ON_FOCUS, True)
    cui_Button_Button.set_style_bg_color(lv.color_hex(0xFFFFFF), lv.PART.MAIN | lv.STATE.DEFAULT )
    cui_Button_Button.set_style_bg_opa(0, lv.PART.MAIN| lv.STATE.DEFAULT )
    cui_Button_Button.set_style_bg_img_src( ui_images.ui_img_btn1_png, lv.PART.MAIN | lv.STATE.DEFAULT )
    cui_Button_Button.set_style_text_color(lv.color_hex(0xFFFFFF), lv.PART.MAIN | lv.STATE.DEFAULT )
    cui_Button_Button.set_style_text_opa(255, lv.PART.MAIN| lv.STATE.DEFAULT )
    cui_Button_Button.set_style_bg_img_src( ui_images.ui_img_btn1_press_png, lv.PART.MAIN | lv.STATE.PRESSED )
    cui_Button_Button.set_style_text_color(lv.color_hex(0xFFFFFF), lv.PART.MAIN | lv.STATE.PRESSED )
    cui_Button_Button.set_style_text_opa(255, lv.PART.MAIN| lv.STATE.PRESSED )
    cui_Label_label_button = lv.label(cui_Button_Button)
    cui_Label_label_button.set_text("Next step")
    cui_Label_label_button.set_width(lv.SIZE.CONTENT)	# 1
    cui_Label_label_button.set_height(lv.SIZE.CONTENT)   # 1
    cui_Label_label_button.set_x(0)
    cui_Label_label_button.set_y(-12)
    cui_Label_label_button.set_align( lv.ALIGN.CENTER)
    cui_Label_label_button.set_style_text_font( font_Title, lv.PART.MAIN | lv.STATE.DEFAULT )
    _ui_comp_table[id(cui_Button_Button)]= {"Button_Button" : cui_Button_Button,"Label_label_button" : cui_Label_label_button, "_CompName" : "Button"}
    return cui_Button_Button

