def step3_eventhandler(event_struct):
   target = event_struct.get_target()
   event = event_struct.code
   if event == lv.EVENT.SCREEN_LOAD_START and True:
      topon_Animation(ui_step3_Panel_wizard_group2, 0)
      lefton_Animation(ui_step3_Panel_content_text_group2, 100)
      opaon_Animation(ui_step3_Image_step3_bg, 0)
      opaon_Animation(ui_step3_Image_arrow, 300)
   if event == lv.EVENT.SCREEN_UNLOAD_START and True:
      topoff_Animation(ui_step3_Panel_wizard_group2, 0)
      leftoff_Animation(ui_step3_Panel_content_text_group2, 100)
      opaoff_Animation(ui_step3_Image_step3_bg, 0)
      opaoff_Animation(ui_step3_Image_arrow, 0)
   return

def step3_Button_Button2_Button_Button_eventhandler(event_struct):
   target = event_struct.get_target()
   event = event_struct.code
   if event == lv.EVENT.CLICKED and True:
      ChangeScreen( ui_final, lv.SCR_LOAD_ANIM.FADE_ON, 100, 200)
   return

