def settings_eventhandler(event_struct):
   target = event_struct.get_target()
   event = event_struct.code
   if event == lv.EVENT.SCREEN_LOAD_START and True:
      topon_Animation(ui_settings_Label_settings_label, 0)
      lefton_Animation(ui_settings_Panel_content_text_group4, 100)
      lefton_Animation(ui_settings_Button_back_button, 0)
      opaon_Animation(ui_settings_Image_settings_bg, 0)
   if event == lv.EVENT.SCREEN_UNLOAD_START and True:
      topoff_Animation(ui_settings_Label_settings_label, 0)
      leftoff_Animation(ui_settings_Panel_content_text_group4, 100)
      leftoff_Animation(ui_settings_Button_back_button, 0)
      opaoff_Animation(ui_settings_Image_settings_bg, 0)
   return

def settings_Button_back_button_eventhandler(event_struct):
   target = event_struct.get_target()
   event = event_struct.code
   if event == lv.EVENT.CLICKED and True:
      ChangeScreen( ui_main_menu, lv.SCR_LOAD_ANIM.FADE_ON, 100, 200)
   return

